description:
Find and save your people in Empress of the Deep 3: Legacy of the Phoenix game! Jacob put Anna to sleep a century ago far beneath the ocean waves. Anna awoke without memories and discovered she had a powerful and evil twin Pandora. Anna hunted her, chasing her to the temple in the sky. With the guardians you vanquished Pandora, sending her corrupted soul to the prison in the magic book. World was cleansed, but Anna walk the marble halls alone. Anna's people had fled and now they are in peril! They need their Empress, The Empress of the Deep! Find your missing people in this incredible hidden object puzzle adventure!

